#librerias
import cv2
import numpy as np
import matplotlib.pyplot as plt

"""Imagen de prueba (fire_0048_test):

![fire_0048_test.jpg](data:image/jpeg;base64,)
"""

from google.colab import drive
drive.mount('/content/drive')

"""Canal de RGB:"""

img = cv2.imread('/content/drive/MyDrive/Colab Notebooks/VA deteccion de incendios forestales/fire_0048_test.jpg')
if img is not None:
    img_rgb = cv2.cvtColor(img, cv2.COLOR_BGR2RGB)
else:
    print("Image not loaded. Check the file path.")

img_R = img_rgb[:,:,0]
img_G = img_rgb[:,:,1]
img_B = img_rgb[:,:,0]

figura, (ax1, ax2, ax3) = plt.subplots(1,3, figsize=(30, 7))

figura.suptitle('Canales RGB', fontsize=20)
ax1.set_title('Canal R')
ax1.imshow(img_R, cmap='gray', aspect='auto')
ax2.set_title('Canal G')
ax2.imshow(img_G, cmap='gray', aspect='auto')
ax3.set_title('Canal B')
ax3.imshow(img_B, cmap='gray', aspect='auto')

"""Canal XYZ"""

img_xyz = cv2.cvtColor(img_rgb,cv2.COLOR_RGB2XYZ)

img_X = img_xyz[:,:,0]
img_Y = img_xyz[:,:,1]
img_Z = img_xyz[:,:,2]

figura, (ax1, ax2, ax3) = plt.subplots(1,3, figsize=(30, 7))

figura.suptitle('Canales XYZ', fontsize=20)
ax1.set_title('Canal X')
ax1.imshow(img_X, cmap='gray', aspect='auto')
ax2.set_title('Canal Y')
ax2.imshow(img_Y, cmap='gray', aspect='auto')
ax3.set_title('Canal Z')
ax3.imshow(img_Z, cmap='gray', aspect='auto')